import moment from "moment";
import { weekdayArray } from "../constant/constants.js";
import { CalendarContainer, CalendarWeekContainer, CalendarWeekDayContainer } from "../styledComponent/style.js";

function MyCalendar() {
    const year = 2022;
    const month = 5;

    const startOfMonth = moment().year(year).month(month).startOf("month").format("e");
    const endOfMonth = moment().year(year).month(month).endOf("month").format("e");
    console.log(`end of month : ${endOfMonth}`)

    return (
        <CalendarContainer>
            <CalendarWeekContainer>
                {weekdayArray.map((weekday, idx) => <CalendarWeekDayContainer key={idx}>{weekday}</CalendarWeekDayContainer>
                )}
            </CalendarWeekContainer>
        </CalendarContainer>
    );
}

export default MyCalendar;
